import React from "react";
import ClueItem from "./ClueItem";
import cl from "./ClueList.module.css";

const ClueList = ({ clues, title }) => {
  if (!clues.length) {
    return <h1 style={{ textAlign: "center" }}>No questions found!</h1>;
  }
  return (
    <div>
      <div style={{ width: "472px" }}>
        <h1 className={cl.title} style={{ textAlign: "center" }}>
          {title}
        </h1>
        {clues.map((clue, index) => (
          <ClueItem key={clue.id} number={index + 1} clue={clue} />
        ))}
      </div>
    </div>
  );
};

export default ClueList;
